import '../styles.css';
import {ReactComponent as Hocket} from '../../assets/img/lauch.svg';

function Home() {
    return (
        <div className="pages-form-container">
            <div className="pages-card-bottom-container">

                <div className="float-child">
                    <a href="./project"><h2>Projeto</h2></a>
                    <a href="./team"><h2>Time</h2></a>
                    <a href="./member"><h2>Membro</h2></a>
                </div>

                <div className='float-child'>
                    <Hocket />
                </div>

            </div >
        </div >
    )
}

export default Home;
